import React from "react";
import logo from "./logo.svg";
import "./App.css";
import ButtonComponent from "./components/atom/Button";
import SearchFieldComponent from "./components/atom/SearchBar";
import { TableRow, ThemeProvider, Typography } from "@mui/material";
import theme from "./theme/theme";
import Logotext from "./components/molecules/LogoText";
import Navbar from "./components/molecules/NavBar";
import ImageCard from "./components/molecules/ImageCard";
import CarImage from "./images/card-img.svg";
import TableContent from "./components/molecules/TableContent";
import FooterArtApi from "./components/molecules/FooterArtApi";
import ImageCardDetail from "./components/molecules/ImageCardDetail";
import TextBackButton from "./components/molecules/TextBackButton";
import PageNumbers from "./components/molecules/PageNumbers";
import "@fontsource/roboto/300.css";
import "@fontsource/roboto/400.css";
import "@fontsource/roboto/500.css";
import "@fontsource/roboto/700.css";
import ApiData from "./artapi";
import ImageConstructor from "./components/atom/imageConstructor";
import ArtworkGrid from "./components/organisms/allArtwork";
import ArtWorkDetails from "./components/organisms/ArtWorkDetials";
import ArtWorkText from "./components/atom/AllArtWorkText";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import HomePage from "./pages/HomePage";
import DetailsPage from "./pages/DetailPage";

function App() {
  return (
    <ThemeProvider theme={theme}>
      <Router>
        <div className="App">
          <>
          <ApiData/>
            <Routes>
              <Route path="/" element={<HomePage />} />
              <Route path="/artwork/:objectNumber" element={<DetailsPage />} />
            </Routes>
          </>
        </div>
      </Router>
    </ThemeProvider>
  );
}

export default App;
